import React, { useState } from "react";
import Account from "./Routes/Account";
import Pages from "./Routes/Pages";

const App = () => {

  const [show, setShow] = useState();
  var buttonText = show ? <Account/> : "Show Component";
  return (
    <>
      <Account />
      <Pages />
    </>
  );
};

export default App;
